  return (
    <ol>
      {data?.map((questionYear) => {
        if (questionYear.year === year) {
          if (question.data.type === type) {
            console.log(question.data.data);
            return (
              <li key={question.data.data.id}>
                <label>
                  <h3>{question.data.data.question}</h3>
